import React from "react";
import Container from "../Container.jsx";

const Header = () => {
  const isAuth = true;

  return (
    <header className="header">
      <Container>
        <div className="header__logo">
          <h2>
            React <span>Blog</span>
          </h2>
        </div>
        <div className="header__sign">
          {isAuth ? (
            <>
              <button className="button-reverse header__button-add">
                Add Post
              </button>
              <button className="button header__button-logout">Logout</button>
            </>
          ) : (
            <>
              <button className="button header__button-signin">Sign In</button>
              <button className="button-reverse header__button-signup">
                Sign Up
              </button>
            </>
          )}
        </div>
      </Container>
    </header>
  );
};

export default Header;
